	"canonicalTransform": "function canonical(relationalData, basicOptions) {\n    let subset = (a, b) =\u003e { // 'a' is a subset of 'b'\n        return (_.difference(a, b).length === 0);\n    };\n    let keysWeNeed = [basicOptions.xKey];\n    if (_.some(relationalData, row =\u003e {\n        return (! subset(keysWeNeed, _.keys(row)));\n    })) throw new Error(\"xKey of basic options needs to be present in every object in the input data array\");\n\n    let ts = [{\n        key: \"Candlestick Data\",\n        values: relationalData.map(function(row) {\n            return {\n                x: row[basicOptions.xKey],\n                high: row[basicOptions.highKey],\n                low: row[basicOptions.lowKey],\n                open: row[basicOptions.openKey],\n                close: row[basicOptions.closeKey]\n            };\n        })\n    }];\n    return ts; \n}\n",
