	"advancedOptions": "{\n    chart: {\n        type: 'ohlcBarChart',\n            margin : {\n                top: 20,\n                right: 20,\n                bottom: 40,\n                left: 60\n            },\n            y: function(d){ return d['close']; },\n            xAxis: {\n                axisLabel: 'Dates',\n                tickFormat: function(d) {\n                    return d3.time.format('%x')(new Date(new Date() - (20000 * 86400000) + (d * 86400000)));\n                },\n                showMaxMin: false\n            },\n            yAxis: {\n                axisLabel: 'Stock Price',\n                tickFormat: function(d){\n                    return '$' + d3.format(',.1f')(d);\n                },\n            showMaxMin: false\n        }\n    }\n}\n",
